import React from 'react';
import './Header.css';

const socialLinks = [
    {
        href: 'https://www.facebook.com/',
        src: './images/social/facebook.png',
        alt: 'Facebook'
    },
    {
        href: 'https://www.twitter.com/',
        src: './images/social/twitter.png',
        alt: 'Twitter'
    },
    {
        href: 'https://www.instagram.com/',
        src: './images/social/instagram.png',
        alt: 'Instagram'
    },
    {
        href: 'https://www.linkedin.com/',
        src: './images/social/linkedin.png',
        alt: 'LinkedIn'
    }
];

const Header = () => {
    return (
        <div className="header">
            <img src="./images/kasa/KasaanOylogo.png" alt="Logo" className="header-logo" />
            <div className="header-text-container">
                <h1 className="header-title">Kasaan Oy</h1>
                <p className="header-subtitle">Yarbo maahantuoja</p>
            </div>
            <div className="social-icons">
                {socialLinks.map((link, index) => (
                    <a key={index} href={link.href} className="social-link" target="_blank" rel="noopener noreferrer">
                        <img src={link.src} alt={link.alt} className="social-icon" />
                    </a>
                ))}
            </div>
        </div>
    );
};

export default Header;
